import "../stylesheets/App.css";
import data from "../data/data.json";
import PokeList from "./PokeList";

const App = () => {
  const [pokemon] = useState(data);
  return (
    <div>
      <h1>Mi lista de Pokemon</h1>
      <PokeList pokemonData={pokemon} />
    </div>
  );
};
export default App;
